import React from 'react';
import Sound from 'react-sound';
import dmx from '../common/dmx.mp3'

alert = (tSc) => {
    this.myRef = React.createRef();
    if(tSc === timerStates.COMPLETE)
        return (
            <audio ref={this.myRef} src={dmx} autoPlay/>
        )
}
